import React, {useEffect, useState} from "react";
import axios from "axios";

function App() {
const [test, setTest] = useState([])

    useEffect(() => {
      axios("/api/tests/get-test/js").then(({data}) => {
          setTest(data)
      })
    },[])

  return (
    <div className="App">
        <div className="row">
            {
                test?.map(it => <div className="col-4">{it.question}</div>)
            }
        </div>
    </div>
  )
}

export default App;
